import { default as React } from 'react';
import { Link } from 'react-router-dom';
import { FaTimes, FaHamburger } from 'react-icons/fa';

import * as Routes from '../../routes';

import './nav.scss';

const MainNavigation = () => {

	return (
		<div className="navigation-main">
			<div className="navigation-main__hamburger">
				<FaHamburger size={42} />
			</div>
			<div className="navigation-main__nav">
				<div className="navigation-main__nav-times">
					<FaTimes />
				</div>
				<div className="navigation-main__nav-wrapper">
					<Link><h1>HOME</h1></Link>
					<Link><h1>DOCUMENTATION</h1></Link>
					<Link><h1>INFO</h1></Link>
					<Link><h1>CONTACT</h1></Link>
				</div>
			</div>

		</div>
	);
};

export default MainNavigation;
